CREATE TABLE IF NOT EXISTS estandares.nanda_diagnostico ( 
    id SERIAL PRIMARY KEY, 
    clase_fk INTEGER, 
    codigo TEXT NOT NULL, 
    nombre TEXT NOT NULL, 
    version TEXT NOT NULL, 
    deleted BOOLEAN DEFAULT FALSE, 
    CONSTRAINT nanda_clase_fk FOREIGN KEY (clase_fk) REFERENCES estandares.nanda_clase(id) 
);
CREATE TABLE IF NOT EXISTS estandares.nanda_nic_nanda_diagnostico ( 
    nanda_fk INTEGER, 
    nic_fk   INTEGER, 
    CONSTRAINT nanda_rel FOREIGN KEY (nanda_fk) REFERENCES estandares.nanda_diagnostico(id), 
    CONSTRAINT nic_rel FOREIGN KEY (nic_fk) REFERENCES estandares.nanda_nic(id) 
);
